import PropTypes from 'prop-types';
import '../styles/Navbar.scss'

const Navbar = (props) => (
<div id="nav">
    <a href="#" className="closeBtn" >
        &times;
    </a>
    <div className="overlay-content" onClick={props.onCloseNav}>
        <a href="#">Catalogs</a>
        <a href="#">Cars</a>
        <a href="#">Create a Catalog</a>
        <a href="#">Create a Car</a>
    </div>
</div>
);

Navbar.propTypes = {
    onCloseNav: PropTypes.func
}
export default Navbar;
